const Forms = () => {




    return (
        <>
            <div>
                <h1>Hello</h1>
                <input type="text" placeholder="Enter Yoyr Name" defaultValue="" /> <br /> <br />
                <button>Click Me</button>
            </div>
        </>
    )
}

export default Forms
